import React from "react";
import { Col } from "antd";
import { WrapperHeader, LogoText, NavbarWrapper, NavItem, SubnavItem, Dropdown, Subnav } from "./style";
const HeaderComponent = () => {
  return (
    <div>
      <WrapperHeader>
        <Col span={8}>
          <img src="" alt="" />
          <LogoText>Yen Scented Candle</LogoText>
        </Col>
        <Col span={8}>
          <NavbarWrapper>
            <NavItem>Home</NavItem>
            <NavItem>About</NavItem>
            <Dropdown>
              <NavItem>Services</NavItem>
              <Subnav className="subnav">
                <SubnavItem>Service 1</SubnavItem>
                <SubnavItem>Service 2</SubnavItem>
                <SubnavItem>Service 3</SubnavItem>
              </Subnav>
            </Dropdown>
            <NavItem>Contact</NavItem>
          </NavbarWrapper>
        </Col>
        <Col span={8}>col-8</Col>
      </WrapperHeader>
    </div>
  );
};

export default HeaderComponent;
